import {Link} from "react-router-dom";


const NavBar = ()=>{
    return(
        <nav>
            <img></img>
            <Link to="/home">Go To Home</Link>
            <Link to="/form">Create your Pokemon!</Link>
        </nav>
    )
}

export default NavBar;
